//https://leetcode.com/problems/triangle
class Solution {
public:
    int minimumTotal(vector<vector<int>>& triangle) {
        vector<vector<int>> dp(triangle.size(), vector<int>(triangle.size(), INT_MAX));
        dp[0][0] = triangle[0][0];
        for(int r=0; r<triangle.size()-1; r++){
            for(int c=0; c<triangle[r].size(); c++){
                dp[r+1][c] = min(dp[r+1][c], dp[r][c]+triangle[r+1][c]);
                dp[r+1][c+1] = min(dp[r+1][c+1], dp[r][c]+triangle[r+1][c+1]);
            }
        }
        int val = INT_MAX;
        for(int c=0; c<triangle[triangle.size()-1].size(); c++){
            val = min(val, dp[triangle.size()-1][c]);
        }
        return val;
    }
};
